 // \u8bb0\u5f55\u6700\u5c0f\u4e32\u7684\u957f\u5ea6\n        string ans = "";\n\n        while (right < s.size()) {\n            // \u53f3\u8fb9\u5c4a\u662f\u5426\u9700\u8981\u7edf\u8ba1\n            if (need.count(s[right]) == 1) {\n                window[s[right]]++;\n                if (window[s[right]] == need[s[right]]) {\n                    cnt++;\n                }\n            }\n            // \u5de6\u8fb9\u5c4a\u6536\u7f29 + \u7edf\u8ba1\u7b54\u6848\n            while (cnt == need.size()) {\n                if (right - left + 1 < length) {\n                    ans = s.substr(left, right - left + 1);\n                    length = right - left + 1;\n                    // cout << ans << endl;\n                }\n                if (need.count(s[left]) == 1) {\n                    if (window[s[left]] == need[s[left]]) {\n                        cnt--;\n                    }\n                    window[s[left]]--;\n                }\n                left++;\n            }\n            right++;\n        }\n\n        return ans;\n    }\n};\n')))}u.isMDXComponent=!0}}]);